                WriteLiteral(@"</strong></span></span></span></em><strong>Оценка транспорта и транспортных  средств</strong> - это определение стоимости объектов, используемых для  личного пользования, коммерческого пользования, с целью перевозок  грузов, товаров и пассажиров, а также контейнеров и другого  транспортного оборудования, с учетом технического состояния, физического  и функционального износа.</p>
                <p style=""text-indent: 25px; text-align: justify;"">Оценка производится в соответствии с нормами  законодательства Украины, в частности, с Национальными стандартами  Украины №1, 2, 3, Методикой оценки дорожных транспортных средств, а  также с Международными стандартами оценки (МСО), на основании Договора с  Заказчиком.</p>
                <p style=""text-indent: 25px;"">Оценка транспортных средств выполняется для раздела имущества в суде,  вступления в наследство (для нотариуса), внесения в уставный капитал  юридического лица, купли-продажи автомобиля, подтверждения таможенной  стоимости, лизинга, передачи в залог, опре");
